Okay, let's break down the ultimatum game and formulate a computational model for responder behavior.

**Psychological Mechanisms:**

1.  **Fairness Evaluation:** Responders assess the fairness of the proposed split. This isn't necessarily about absolute monetary value, but relative value considering the contributions of each player. Discrepancies between expected and actual fairness can lead to rejection.
2.  **Contribution Consideration:** The token amounts found by each player impact the evaluation of fairness. If the responder found more tokens, they might expect a larger share.
3.  **Loss Aversion:** Rejection means losing the offered amount. However, accepting an unfair offer might feel like a loss of self-respect or conceding to unfairness. People generally dislike losses more than equivalent gains.
4.  **Inequity Aversion:** Responders may reject offers perceived as unfair, even if it means receiving nothing. This aversion stems from a distaste for unequal outcomes. This concept can be further thought of as having "advantageous inequity aversion" and "disadvantageous inequity aversion".
5.  **Threshold for Acceptance:** Individuals have a threshold of fairness that once crossed will cause them to accept, and below that they reject.

**Model Interactions:**

*   The model needs to quantify the subjective fairness evaluation based on the proposed split, the contributions of each player, and the total amount to be divided.
*   The fairness evaluation should be modulated by parameters reflecting individual differences in fairness preferences, loss aversion, and inequity aversion.
*   The utility of accepting an offer should be weighed against the utility of rejecting it (getting nothing, but potentially punishing unfair behavior). A utility function that models the tradeoff between monetary gain and perceived fairness.

**Mathematical Form:**

A utility function could be constructed based on the following:

*   **Monetary Gain:** The proposed amount for the responder (`split_self`).
*   **Fairness Comparison:** A comparison between the proposed split and an "ideal" or "fair" split. The ideal split could be influenced by relative token contributions (`token_self`, `token_opp`).
*   **Inequity Aversion:** This modulates the impact of deviations from fairness, potentially asymmetrically for advantageous vs. disadvantageous inequity.

